import React from 'react'
import Home from './home'
import MyNav from './myNav'

export default class App extends React.Component{
    render(){
        const nav1 = ['张三', '李四' , '王五']
        const nav2 = ['web', 'java' , 'c++']
        return(
            <div>
                <h1>我是去 的</h1>
                <Home/>
                <MyNav nav = {nav1}/>
                <MyNav nav2/>
            </div>
        )
    }
}
